import Carousel1 from './images/carousel1.jpg';
import Carousel2 from './images/carousel2.jpg';
import Carousel3 from './images/carousel3.jpg';



const Homecarousel = () =>{
    return (
        <div className="homecarousel">
            <div class="carousel-1" id="carousel-1"><img src={Carousel1} height="100%" width="100%"/></div>
            <div class="carousel-2" id="carousel-2"><img src={Carousel2} height="100%" width="100%"/></div>
            <div class="carousel-3" id="carousel-3"><img src={Carousel3} height="100%" width="100%"/></div>
        </div>
    );
};

export default Homecarousel;
